import React from 'react'
import { StyleSheet, View, Image } from 'react-native'

export function Card({ children }) {
	return <View style={styles.cardContainer}>{children}
	
	<Image
        style={styles.pigpng}
        source={require('pig.png')}
      />
	
	</View>
}

const styles = StyleSheet.create({
	cardContainer: {
		padding: 8,
		backgroundColor: '#fff',
		borderWidth: 1,
		borderColor: '#a1a1a1',
	},

	pigpng: {
		width: 66,
		height: 58,
	  },
})
